//App.js

import React from 'react';
import Footer from "./Footer"
import Header from "./Header"
import List from "./List"
import InputBox from "./InputBox"
import CheckBox from "./CheckBox"
import ContactCard from "./ContactCard"
import RideForm from "./RideForm"
import Chart from "./Chart"
import BarGraph from "./BarGraph"
import Logo from "./Logo"
import TodayButton from "./TodayButton"
import PlanButton from "./PlanButton"
import MyComponent from "./MyComponent"
import { Router } from 'react-router-dom';
import {Route} from "react-router-dom";
import {Link} from "react-router-dom";

//import AppRouter from "./AppRouter"
//import { ReactComponent as Logo } from './Magic Minutes Transparent.png'; // Tell Webpack this JS file uses this image


//import { Router, Route, browserHistory } from 'react-router'


function App(){
	return(
		<div>
			<nav>
				<Logo />
				<ul>
          			<li>
           				<Link to="/">Home</Link>
          			</li>
          			<li>
           			 	<Link to="/plan">Plan Your Trip</Link>
          			</li>
          			<li>
            			<Link to="/today">Ride Times Today</Link>
          			</li>
        		</ul>

        		<hr />

        		<Route exact path="/" component={Home} />
        		<Route path="/plan" component={Plan} />
        		<Route path="/today" component={Today} />

			</nav>
			<main>		
				<Chart />
				<Footer />
			</main>
		</div>

		/*
		<div className = "contacts">
		<ContactCard 
		name = "abby" 
		imgURL = "https://www.google.com/url?sa=i&rct=j&q=&esrc=s&source=images&cd=&cad=rja&uact=8&ved=2ahUKEwjdpKi339rhAhWIwVQKHRufDMwQjRx6BAgBEAU&url=https%3A%2F%2Fwww.akc.org%2Fexpert-advice%2Fhealth%2Fpuppies-how-much-exercise%2F&psig=AOvVaw0Wtbtq0cXHYpKbUOr05e0H&ust=1555714805847172"
		address = "98765432dfghjk"
		/>
		</div>
		*/
	)
}

function Home() {
  return (
    <div>
      <Logo />
      <Chart />
      <Footer />
    </div>
  );
}

function Plan() {
  return (
    <div>
      <h2>The crowds for the next 30 days</h2>
    </div>
  );
}

function Today() {
  return (
    <div>
      <h2>Ride Wait Times</h2>
      <RideForm />
    </div>
  );
}

export default App
